function addNameCombination(map, first, last, playerdata){
	if (first && last){
		var full = first + " " + last;
		if (map[full]){
			map[full].push(playerdata)
		} else {
			map[full] = [playerdata];
		}
	}
}

function convertPlayerArrayToMaps(player_array){
	var result = {
		sport:'mlb',
		count:player_array.length,
		yahoo:{},	
		espn:{},	
		cbs:{},	
		nfl:{},	
		mfl:{},	
		rt:{},	
		flea:{},	
		names:{},		
		players:{}
	};
	for (var i=0; i<player_array.length; i++){
		var p = player_array[i];
		result.players[p.fp] = p;
		if (p.y){result.yahoo[String(p.y)] = p.fp}
		if (p.e){result.espn[String(p.e)] = p.fp}
		if (p.c){result.cbs[String(p.c)] = p.fp}
		if (p.n){result.nfl[String(p.n)] = p.fp}
		if (p.m){result.mfl[String(p.m)] = p.fp}
		if (p.rt){result.rt[String(p.rt)] = p.fp}
		if (p.ff){result.flea[String(p.ff)] = p.fp}
		addNameCombination(result.names, p.fn, p.ln, p);
		addNameCombination(result.names, p.fn, p.aln, p);
		addNameCombination(result.names, p.afn, p.ln, p);
		addNameCombination(result.names, p.afn, p.aln, p);
	}
	result.yahoo[1000001] = 7812; //Ohtani the hitter
	return result;
}

MLB_PLAYER_DATA = MLB_PLAYER_DATA_HARDCODED;
PLAYER_CACHE = convertPlayerArrayToMaps(MLB_PLAYER_DATA.players);

chrome.runtime.sendMessage({'cmd' :'getPlayerData', 'sport':'mlb'}, function(result){  
	if (result && result.count){
		var cancelUpdate = false;
		if (MLB_PLAYER_DATA && MLB_PLAYER_DATA.count){
	//		console.log("feed has " + result.count +  "  vs. " + MLB_PLAYER_DATA.count);
			if (MLB_PLAYER_DATA.count > 2 * result.count){
				cancelUpdate = true;
			}
		}
		if (!cancelUpdate){
			MLB_PLAYER_DATA = result;
			PLAYER_CACHE = convertPlayerArrayToMaps(result.players);
		}
	}
});
